import React, { useState, useEffect } from 'react';
import './NewsFeed.css';

const NewsFeed = () => {
  const [news, setNews] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  // Mock news data - in a real app, this would come from an API
  const mockNews = [
    {
      id: 1,
      title: "Real Madrid Secures Thrilling Victory in Champions League",
      summary: "Real Madrid clinched a dramatic 3-2 win against Manchester City in the Champions League quarter-finals.",
      date: "2024-03-15",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Match Report"
    },
    {
      id: 2,
      title: "MbappÃ© Breaks Scoring Record in La Liga",
      summary: "Kylian MbappÃ© scored his 25th goal of the season, setting a new club record for goals in a single La Liga campaign.",
      date: "2024-03-12",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Player Performance"
    },
    {
      id: 3,
      title: "Real Madrid Announces New Youth Academy Partnership",
      summary: "The club has partnered with local schools to develop grassroots football talent across Madrid.",
      date: "2024-03-10",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Club News"
    },
    {
      id: 4,
      title: "Ancelotti Praises Team Spirit After Difficult Season",
      summary: "Carlo Ancelotti highlighted the team's resilience and unity following a challenging period.",
      date: "2024-03-08",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Manager Comments"
    },
    {
      id: 5,
      title: "Real Madrid Foundation Donates to Local Communities",
      summary: "The club's charitable foundation has contributed â‚¬500,000 to support education and healthcare initiatives.",
      date: "2024-03-05",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Community"
    },
    {
      id: 6,
      title: "Vini Jr. Returns from Injury with Assist in Training",
      summary: "VinÃ­cius JÃºnior made a successful return to training and provided an assist in the session.",
      date: "2024-03-03",
      image: "https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Real_Madrid_CF.svg/1200px-Real_Madrid_CF.svg.png",
      category: "Injury Update"
    }
  ];

  useEffect(() => {
    // Simulate API call
    const timer = setTimeout(() => {
      setNews(mockNews);
      setIsLoading(false);
    }, 1500);

    return () => clearTimeout(timer);
  }, []);

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('en-US', {
      year: 'numeric',
      month: 'long',
      day: 'numeric'
    });
  };

  const getCategoryColor = (category) => {
    switch (category.toLowerCase()) {
      case 'match report': return '#e74c3c';
      case 'player performance': return '#27ae60';
      case 'club news': return '#3498db';
      case 'manager comments': return '#9b59b6';
      case 'community': return '#e67e22';
      case 'injury update': return '#e74c3c';
      default: return '#95a5a6';
    }
  };

  if (isLoading) {
    return (
      <div className="news-feed">
        <h2>ðŸ“° Latest News</h2>
        <div className="news-loading">
          <div className="loading-spinner"></div>
          <p>Loading latest news...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="news-feed">
      <h2>ðŸ“° Latest News</h2>
      <div className="news-grid">
        {news.map((item, index) => (
          <article
            key={item.id}
            className="news-card"
            style={{'--card-index': index}}
          >
            <div className="news-image">
              <img src={item.image} alt={item.title} />
              <span
                className="news-category"
                style={{ backgroundColor: getCategoryColor(item.category) }}
              >
                {item.category}
              </span>
            </div>
            <div className="news-content">
              <h3>{item.title}</h3>
              <p className="news-summary">{item.summary}</p>
              <div className="news-meta">
                <time dateTime={item.date}>{formatDate(item.date)}</time>
                <button className="read-more-btn">Read More â†’</button>
              </div>
            </div>
          </article>
        ))}
      </div>
    </div>
  );
};

export default NewsFeed;
